import React from "react";
import Modal from "../Modal";
import history from "../../history";
import { fetchSingleTemplate } from "../../actions";
import { connect } from "react-redux";
class TemplateShow extends React.Component {
  componentDidMount() {
    this.props.fetchSingleTemplate(this.props.match.params.id);
  }
  render() {
    return (
      <div>
        <Modal />
      </div>
    );
  }
}

const mapStateToProps = (state, ownProps) => {
  return {
    templates: state.strams[ownProps.match.params.id]
  };
};
export default connect()(TemplateShow);
